import React from 'react';

function Map1() {
    const apiUrl = 'https://api.github.com/users/hacktivist123/repos';
    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => console.log('This is your data', data));
    return (
        <React.Fragment>
            <p>I'm a new component</p>
        </React.Fragment>
    )



}

export default Map1
